package org.example.entity;import java.time.LocalDateTime;public class Warehouse {    private int id;    private String name;    private boolean isActive;    private String description;    private String createdBy;    private LocalDateTime created;    public Warehouse() {}    public Warehouse(int id, String name, boolean isActive, String description, String createdBy,                     LocalDateTime created) {        this.id = id;        this.name = name;        this.isActive = isActive;        this.description = description;        this.createdBy = createdBy;        this.created = created;    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public boolean getActive() {        return isActive;    }    public void setActive(boolean active) {        isActive = active;    }    public String getDescription() {        return description;    }    public void setDescription(String description) {        this.description = description;    }    public String getCreatedBy() {        return createdBy;    }    public void setCreatedBy(String createdBy) {        this.createdBy = createdBy;    }    public LocalDateTime getCreated() {        return created;    }    public void setCreated(LocalDateTime created) {        this.created = created;    }}